const ViewGeotiff = () => {
	return (
		<div>
			<a href="http://data.rcc-acis.org/GridData?params={%22state%22:%22ne,ok%22,%22grid%22:%221%22,%22output%22:%22image%22,%22date%22:%222012-6%22,%22elems%22:[{%22name%22:%22maxt%22,%22interval%22:%22mly%22,%22duration%22:%22mly%22,%22reduce%22:%22max%22}],%22image%22:{%22proj%22:%22lcc%22,%22overlays%22:[%22county:1:gray%22,%22state:2:purple%22],%22interp%22:%22cspline%22,%22width%22:350,%22levels%22:[90,95,100,105,110]}}">View map image</a>
		</div>
	);
}

export default ViewGeotiff;
